      SELECT ALL 15 + + col2 FROM tab0 (FORMAT parquet) AS cor0 WHERE + col0 * ( - col2 * + col1 ) NOT BETWEEN + 72 + col2 * col0 AND col2;
  - name: tab0

outputs:
